script: |
  super -f text -I q9005.spq | sort > q9005.out

inputs:
  - name: q9005.spq
    data: |
      SELECT DISTINCT - + col2 / 15 + + 75 AS col2, 36 / + col1 * + - col0 + - 92 * 10 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q9005.out
    data: |
      72	-920
      73	-920
      74	-920
